 "html": "<div style=\"text-align:left; color:#000; \"><DIV STYLE=\"text-align:center;\"><SPAN STYLE=\"letter-spacing:0px;color:#000000;font-family:Arial, Helvetica, sans-serif;\"><SPAN STYLE=\"color:#fec94b;font-size:55px;font-family:'Cinzel Bold';\"><B>SEJARAH DAN PROFILE</B></SPAN></SPAN></DIV><p STYLE=\"margin:0; line-height:55px;\"><BR STYLE=\"letter-spacing:0px;color:#000000;font-size:11px;font-family:Arial, Helvetica, sans-serif;\"/></p></div>",
