 "paddingBottom": 0,
 "html": "<div style=\"text-align:left; color:#000; \"><DIV STYLE=\"text-align:left;\"><SPAN STYLE=\"letter-spacing:0px;color:#000000;font-family:Arial, Helvetica, sans-serif;\"><SPAN STYLE=\"color:#ffffff;font-size:33px;font-family:'Antonio';\"><B>Mission</B></SPAN></SPAN></DIV><p STYLE=\"margin:0; line-height:11px;\"><BR STYLE=\"letter-spacing:0px;color:#000000;font-size:7px;font-family:Arial, Helvetica, sans-serif;\"/></p><DIV STYLE=\"text-align:left;\"><SPAN STYLE=\"letter-spacing:0px;color:#000000;font-family:Arial, Helvetica, sans-serif;\"><SPAN STYLE=\"color:#ffffff;font-size:18px;font-family:'Open Sans Semibold';\">(1) Realizing and preserving the historical cultural heritage from damage and extinction.</SPAN></SPAN></DIV><DIV STYLE=\"text-align:left;\"><SPAN STYLE=\"letter-spacing:0px;color:#000000;font-family:Arial, Helvetica, sans-serif;\"><SPAN STYLE=\"color:#ffffff;font-size:18px;font-family:'Open Sans Semibold';\">(2) Conducting research and scientific studies on the cultural heritage that is part of the collections of the Bali Museum.</SPAN></SPAN></DIV><DIV STYLE=\"text-align:left;\"><SPAN STYLE=\"letter-spacing:0px;color:#000000;font-family:Arial, Helvetica, sans-serif;\"><SPAN STYLE=\"color:#ffffff;font-size:18px;font-family:'Open Sans Semibold';\">(3) Communicating and exhibiting museum collections to the public to raise awareness and understanding in the preservation of cultural heritage.</SPAN><SPAN STYLE=\"color:#ffffff;font-size:11px;font-family:'Open Sans Semibold';\"> </SPAN></SPAN></DIV></div>",
