 "scrollBarMargin": 2,
 "paddingRight": 0,
 "width": "99.964%",
 "shadow": false,
 "backgroundOpacity": 1,
 "paddingTop": 20,
 "borderRadius": 0,
 "backgroundColor": [
  "#D28A5A"
 ],
 "paddingBottom": 0,
 "html": "<div style=\"text-align:left; color:#000; \"><DIV STYLE=\"text-align:justify;\"><SPAN STYLE=\"letter-spacing:0vh;color:#000000;font-family:Arial, Helvetica, sans-serif;\"><SPAN STYLE=\"color:#ffffff;font-size:2.44vh;font-family:'Open Sans Semibold';\">Balai Pecanangan, tempat untuk menyiapkan sesajian dan sekaligus menyimpan alat-alat upacara keagamaan, dibangun pada tahun 1935 setelah Ni Pollok menjadi istri Le Mayeur dan tinggal menetap sebagai ibu rumah tangga disamping menjadi model lukisan.</SPAN></SPAN></DIV><DIV STYLE=\"text-align:justify;\"><SPAN STYLE=\"letter-spacing:0vh;color:#000000;font-family:Arial, Helvetica, sans-serif;\"><SPAN STYLE=\"color:#ffffff;font-size:2.44vh;font-family:'Open Sans Semibold';\">Setelah Le Mayeur meninggal dunia (1958) Ni Pollok harus hidup sendiri, Balai Pecanangan ini pernah dijadikan toko kesenian (art shop), dan penghasilannya cukup lumayan, kemudian semakin berkurang bahkan jauh dari cukup, art shop kemudian dipindahkan kedepan menghadap ke pantai. seperti yang ada sekarang dan Balai Pecanangan ini difungsikan kembali seperti semula sampai Ni Pollok meninggal dunia 21 Juli 1985 dan kini difungsikan sebagai ruang perpustakaan dan beberapa koleksi Museum Le Mayeur.</SPAN></SPAN></DIV></div>",
