 "html": "<div style=\"text-align:left; color:#000; \"><DIV STYLE=\"text-align:justify;\"><SPAN STYLE=\"letter-spacing:0vh;color:#000000;font-family:Arial, Helvetica, sans-serif;\"><SPAN STYLE=\"color:#ffffff;font-size:2.44vh;font-family:'Open Sans Semibold';\">Ruang yang sedikit lebih luas ini adalah bekas studio tempat melukis bersama Ni Pollok sebagai model lukisannya, terutama saat saat menjelang penyerahan untuk melengkapi koleksi lukisan yang masih dianggap kurang untuk dijadikan sebuah museum. Setelah menjadi museum Ni Pollok dinyatakan masih berhak mengelola dan menghasilkan untuk memenuhi kebutuhan hidupnya, untuk itu ruangan ini sering dijadikan tempat menerima pengunjung yang ingin makan dan minum bersama Ni Pollok. Kemudian karena dianggap mengganggu keselamatan koleksi lukisan, maka dibangun tempat khusus dengan nama Cafe Bali Night terletak di halaman sebelah timur museum.</SPAN></SPAN></DIV></div>",
