 "html": "<div style=\"text-align:left; color:#000; \"><DIV STYLE=\"text-align:justify;\"><SPAN STYLE=\"letter-spacing:0vh;color:#000000;font-family:Arial, Helvetica, sans-serif;\"><SPAN STYLE=\"color:#ffffff;font-size:2.44vh;font-family:'Open Sans Semibold';\">This little wider room was the ex-art studio, the place for painting with Ni Pollok as a model, especially in the period by the handing over of the house to the government in order to add more collections sufficient for a museum. After becoming a museum, Ni Pollok was still entitled to exploit the house on a commercial basis, that this room was often used as a dinning-room to entertain visitors on a special order. This activity was then realized that it would harm the safety of the collections, so that a Bali Nights Caf\u00e9 was later on erected instead, located at the eastern side of the museum.</SPAN></SPAN></DIV></div>",
