 "backgroundColor": [
  "#D28A5A"
 ],
 "paddingBottom": 0,
 "html": "<div style=\"text-align:left; color:#000; \"><DIV STYLE=\"text-align:justify;\"><SPAN STYLE=\"letter-spacing:0vh;color:#000000;font-family:Arial, Helvetica, sans-serif;\"><SPAN STYLE=\"color:#ffffff;font-size:2.44vh;font-family:'Open Sans Semibold';\">This relatively small room used to be the Le Mayeurs bedroom. Le Mayeur and his wife, Ni Pollok, enjoyed very much using this bedroom that they never shifted to any other room until their departure for a medical treatment to Belgium, where the painter passed away at last in 1958. After the death of Le Mayeur, Ni Pollok kept on sleeping in this room event though she had to allow visitors to enter her bedroom to have a look at some unique collections inside such as: a corner cupboard to keep valuable belongings at the south-west corner of the room, a few wooden boxes decorated with sea-shells used for a sea journey. A bed (already broken and now has been removed) in the midle of the room with its upper end towards east, and a few paintings as well as photographs of Le Mayeur and the young NI Pollok hanging on the wall. In 1985 Ni Pollok fell ill and passed away in the age of 68 years.</SPAN></SPAN></DIV><p STYLE=\"margin:0; line-height:2.44vh;\"><BR STYLE=\"letter-spacing:0vh;color:#000000;font-size:0.95vh;font-family:Arial, Helvetica, sans-serif;\"/></p><p STYLE=\"margin:0; line-height:2.44vh;\"><BR STYLE=\"letter-spacing:0vh;color:#000000;font-size:0.95vh;font-family:Arial, Helvetica, sans-serif;\"/></p></div>",
