 "html": "<div style=\"text-align:left; color:#000; \"><DIV STYLE=\"text-align:justify;\"><SPAN STYLE=\"letter-spacing:0vh;color:#000000;font-family:Arial, Helvetica, sans-serif;\"><SPAN STYLE=\"color:#ffffff;font-size:2.44vh;font-family:'Open Sans Semibold';\">Tempat ini sengaja dibangun oleh Ni Pollok pada tahun 1970 untuk memenuhi permintaan wisatawan yang ingin bertemu dengan Ni Pollok sambil makan malam bersama. Usaha ini cukup banyak menarik wisatawan sampai kadang-kadang menolak pesanan karena tempat terbatas Kemudian akibat adanya persaingan, Ni Pollok merasa usaha ini tidak perlu dilanjutkan dan bekas lokasi Caf\u00e9 Bali Night kini oleh pemerintah daerah direhabilitasi kembali.</SPAN></SPAN></DIV><p STYLE=\"margin:0; line-height:2.44vh;\"><BR STYLE=\"letter-spacing:0vh;color:#000000;font-size:0.95vh;font-family:Arial, Helvetica, sans-serif;\"/></p><p STYLE=\"margin:0; line-height:2.44vh;\"><BR STYLE=\"letter-spacing:0vh;color:#000000;font-size:0.95vh;font-family:Arial, Helvetica, sans-serif;\"/></p></div>",
