 "html": "<div style=\"text-align:left; color:#000; \"><DIV STYLE=\"text-align:justify;\"><SPAN STYLE=\"letter-spacing:0vh;color:#000000;font-family:Arial, Helvetica, sans-serif;\"><SPAN STYLE=\"color:#ffffff;font-size:2.44vh;font-family:'Open Sans Semibold';\">The open building was erected by Ni Pollok in 1970 to accommodate requests from visitors who wanted to meet Ni Pollok while having dinner together. This effort was successful at the beginning, but later on due to the emergence of some competitors that the caf\u00e9 was then closed. The Provincial Government of Bali has now erected a symilar open building at the ex-location of the caf\u00e9 for the ticket and information counter and a place for relaxation as well.</SPAN></SPAN></DIV><p STYLE=\"margin:0; line-height:2.44vh;\"><BR STYLE=\"letter-spacing:0vh;color:#000000;font-size:0.95vh;font-family:Arial, Helvetica, sans-serif;\"/></p><p STYLE=\"margin:0; line-height:2.44vh;\"><BR STYLE=\"letter-spacing:0vh;color:#000000;font-size:0.95vh;font-family:Arial, Helvetica, sans-serif;\"/></p></div>",
