 "html": "<div style=\"text-align:left; color:#000; \"><DIV STYLE=\"text-align:justify;\"><SPAN STYLE=\"letter-spacing:0vh;color:#000000;font-family:Arial, Helvetica, sans-serif;\"><SPAN STYLE=\"color:#ffffff;font-size:2.44vh;font-family:'Open Sans Semibold';\">This building is used as a place to relax while enjoying the natural beauty of Sanur Beach, which used to have black sand but, since 2004, now has white sand with the sound of waves under the sunlight. Additionally, Le Mayeur often found inspiration here, which he then transferred onto canvas, using Ni Pollok as his model.</SPAN></SPAN></DIV></div>",
