 "html": "<div style=\"text-align:left; color:#000; \"><DIV STYLE=\"text-align:justify;\"><SPAN STYLE=\"letter-spacing:0vh;color:#000000;font-family:Arial, Helvetica, sans-serif;\"><SPAN STYLE=\"color:#ffffff;font-size:2.44vh;font-family:'Open Sans Semibold';\">Bangunan ini dipergunakan untuk tempat melepas lelah sambil menikmati keindahan alam pantai Sanur yang dahulu memiliki pasir hitam tetapi setelah 2004 pantai sanur memiliki pasir putih dengan nyanyian ombak dibawah sinar matahari. Disamping sering Le Mayeur mendapat inspirasi ditempat ini dan kemudin dituangkan diatas kanvas lukisan dengan model Ni Pollok.</SPAN></SPAN></DIV></div>",
