 "id": "HTMLText_4F0C1BDC_5820_3E95_41C2_2188780FFB21",
 "scrollBarColor": "#FEC94B",
 "backgroundColorDirection": "vertical",
 "scrollBarOpacity": 0.5,
 "borderSize": 0,
 "scrollBarVisible": "rollOver",
 "minHeight": 1,
 "minWidth": 1,
 "scrollBarWidth": 10,
 "scrollBarMargin": 2,
 "paddingRight": 0,
