 "backgroundColor": [
  "#D28A5A"
 ],
 "paddingBottom": 0,
 "html": "<div style=\"text-align:left; color:#000; \"><DIV STYLE=\"text-align:justify;\"><SPAN STYLE=\"letter-spacing:0vh;color:#000000;font-family:Arial, Helvetica, sans-serif;\"><SPAN STYLE=\"color:#ffffff;font-size:2.44vh;font-family:'Open Sans Semibold';\">Untuk mengenang suami yang sangat dicintainya, setelah Le-Mayeur meninggal dunia Ni Pollok memesan sebuah patung setengah badan Le-Mayeur dari batu karang dari seorang pemahat bernama I Made Panti. Patung ini ditempatkan di belakang kolam ikan pada bagian tengah museum pada tanggal 1 April 1959, dan pada alas patung ditulis dengan kata-kata \"In Loving Memory of AJ. Le Mayeur de Merpres. Born : February 9, 1880 Bruxelles, Belgium\". Pada tahun 2006 dibuat patung Ni Nyoman Pollok yang disandingkan dengan suaminya AJ. Le Mayeur De Empres. Seluruh biaya bangunan dan tumpuan patungnya merupakan bantuan dari pemerintah sedangkan biaya pembuatan patung Ni Pollok merupakan sumbangan dari keluarganya yaitu keponakannya yang bernama I Nyoman Arka \"Maksud kami mempersandingkan beliau berdua agar keamanan museum tetap terjaga dan arwah beliau tentram di alam baka\".</SPAN></SPAN></DIV><p STYLE=\"margin:0; line-height:2.44vh;\"><BR STYLE=\"letter-spacing:0vh;color:#000000;font-size:0.95vh;font-family:Arial, Helvetica, sans-serif;\"/></p><p STYLE=\"margin:0; line-height:2.44vh;\"><BR STYLE=\"letter-spacing:0vh;color:#000000;font-size:0.95vh;font-family:Arial, Helvetica, sans-serif;\"/></p></div>",
