 "paddingBottom": 0,
 "html": "<div style=\"text-align:left; color:#000; \"><DIV STYLE=\"text-align:justify;\"><SPAN STYLE=\"letter-spacing:0vh;color:#000000;font-family:Arial, Helvetica, sans-serif;\"><SPAN STYLE=\"color:#ffffff;font-size:2.44vh;font-family:'Open Sans Semibold';\">-Description:</SPAN></SPAN></DIV><DIV STYLE=\"text-align:justify;\"><SPAN STYLE=\"letter-spacing:0vh;color:#000000;font-family:Arial, Helvetica, sans-serif;\"><SPAN STYLE=\"color:#ffffff;font-size:2.44vh;font-family:'Open Sans Semibold';\">Depicts seven women wearing cloth without tops, wearing tengkuluk adorned with hibiscus flowers. At the front edge of the pond, two women are visible, one squatting with her right hand resting on the edge of the pool. In front of her, there are two fish, one red and white. Another woman, with her right foot in the pond, is bending over, her right hand holding a fish. On the left side of the pond, there are three women, one lying down with both hands reaching into the pond, and the woman next to her squatting, her right hand resting on the ground while her left hand is picking something up. Another woman behind her is squatting, with both hands resting on a chair. To the left of this woman, there is a long bamboo chair. Two other women are in the middle of the pond squatting, with their left hands picking something up. Another woman behind them is at the edge of the pond squatting, her right hand resting on a statue and her left hand picking flowers. In the middle of the pond, there is a blooming lotus flower, and its edges are filled with flowering plants. On the right side of the pond, there is a statue.</SPAN></SPAN></DIV><p STYLE=\"margin:0; line-height:2.44vh;\"><BR STYLE=\"letter-spacing:0vh;color:#000000;font-size:0.95vh;font-family:Arial, Helvetica, sans-serif;\"/></p><DIV STYLE=\"text-align:justify;\"><SPAN STYLE=\"letter-spacing:0vh;color:#000000;font-family:Arial, Helvetica, sans-serif;\"><SPAN STYLE=\"color:#ffffff;font-size:2.44vh;font-family:'Open Sans Semibold';\">-Artist : Mr. Le-Mayeur</SPAN></SPAN></DIV><DIV STYLE=\"text-align:justify;\"><SPAN STYLE=\"letter-spacing:0vh;color:#000000;font-family:Arial, Helvetica, sans-serif;\"><SPAN STYLE=\"color:#ffffff;font-size:2.44vh;font-family:'Open Sans Semibold';\">-Medium : Canvas and Oil Paint</SPAN></SPAN></DIV><DIV STYLE=\"text-align:justify;\"><SPAN STYLE=\"letter-spacing:0vh;color:#000000;font-family:Arial, Helvetica, sans-serif;\"><SPAN STYLE=\"color:#ffffff;font-size:2.44vh;font-family:'Open Sans Semibold';\">-Colors : Brown, Black, Yellow, Blue, White, Red, and Orange</SPAN></SPAN></DIV><DIV STYLE=\"text-align:justify;\"><SPAN STYLE=\"letter-spacing:0vh;color:#000000;font-family:Arial, Helvetica, sans-serif;\"><SPAN STYLE=\"color:#ffffff;font-size:2.44vh;font-family:'Open Sans Semibold';\">-Storage Location : Room 3 North Wall East of the Door (Repro) / Original in Storage</SPAN></SPAN></DIV><p STYLE=\"margin:0; line-height:2.44vh;\"><BR STYLE=\"letter-spacing:0vh;color:#000000;font-size:0.95vh;font-family:Arial, Helvetica, sans-serif;\"/></p><p STYLE=\"margin:0; line-height:2.44vh;\"><BR STYLE=\"letter-spacing:0vh;color:#000000;font-size:0.95vh;font-family:Arial, Helvetica, sans-serif;\"/></p></div>",
