 "paddingBottom": 0,
 "html": "<div style=\"text-align:left; color:#000; \"><DIV STYLE=\"text-align:justify;\"><SPAN STYLE=\"letter-spacing:0vh;color:#000000;font-family:Arial, Helvetica, sans-serif;\"><SPAN STYLE=\"color:#ffffff;font-size:2.44vh;font-family:'Open Sans Semibold';\">-Description :</SPAN></SPAN></DIV><DIV STYLE=\"text-align:justify;\"><SPAN STYLE=\"letter-spacing:0vh;color:#000000;font-family:Arial, Helvetica, sans-serif;\"><SPAN STYLE=\"color:#ffffff;font-size:2.44vh;font-family:'Open Sans Semibold';\">Depicts six women wearing sarongs and scarves without shirts, exposing their bare chests. They wear traditional ear ornaments and their hair is tied up with cloth headgear adorned with flowers. They are in a pool. A large windowed building with many shutters is visible, and in front of the house, there is a pool. Lotus flowers grow in the pool, and two carp fish can be seen. The pool's edge is adorned with statues. Four women are sitting in this place, their hands dipped into the water. Among them, one woman is washing a winnowing tray in the pool. At the edge of the pool, in shallower water, two people are standing picking flowers. Meanwhile, their left hand holds a saab bora. Around the pool, there are paper flowers, frangipani, hibiscus, and taro plants. On a tree branch, three birds are perched. Flowers are scattered on the ground.</SPAN></SPAN></DIV><p STYLE=\"margin:0; line-height:2.44vh;\"><BR STYLE=\"letter-spacing:0vh;color:#000000;font-size:0.95vh;font-family:Arial, Helvetica, sans-serif;\"/></p><DIV STYLE=\"text-align:justify;\"><SPAN STYLE=\"letter-spacing:0vh;color:#000000;font-family:Arial, Helvetica, sans-serif;\"><SPAN STYLE=\"color:#ffffff;font-size:2.44vh;font-family:'Open Sans Semibold';\">- Artist : Mr. Le-Mayeur</SPAN></SPAN></DIV><DIV STYLE=\"text-align:justify;\"><SPAN STYLE=\"letter-spacing:0vh;color:#000000;font-family:Arial, Helvetica, sans-serif;\"><SPAN STYLE=\"color:#ffffff;font-size:2.44vh;font-family:'Open Sans Semibold';\">- Medium : Hardboard and Oil Paint</SPAN></SPAN></DIV><DIV STYLE=\"text-align:justify;\"><SPAN STYLE=\"letter-spacing:0vh;color:#000000;font-family:Arial, Helvetica, sans-serif;\"><SPAN STYLE=\"color:#ffffff;font-size:2.44vh;font-family:'Open Sans Semibold';\">- Colors : Red, Black, White</SPAN></SPAN></DIV><DIV STYLE=\"text-align:justify;\"><SPAN STYLE=\"letter-spacing:0vh;color:#000000;font-family:Arial, Helvetica, sans-serif;\"><SPAN STYLE=\"color:#ffffff;font-size:2.44vh;font-family:'Open Sans Semibold';\">- Storage Location : Room 5 North Wall</SPAN></SPAN></DIV></div>",
