 "backgroundColor": [
  "#D28A5A"
 ],
 "paddingBottom": 0,
 "html": "<div style=\"text-align:left; color:#000; \"><DIV STYLE=\"text-align:justify;\"><SPAN STYLE=\"letter-spacing:0vh;color:#000000;font-family:Arial, Helvetica, sans-serif;\"><SPAN STYLE=\"color:#ffffff;font-size:2.44vh;font-family:'Open Sans Semibold';\">-Deskripsi :</SPAN></SPAN></DIV><DIV STYLE=\"text-align:justify;\"><SPAN STYLE=\"letter-spacing:0vh;color:#000000;font-family:Arial, Helvetica, sans-serif;\"><SPAN STYLE=\"color:#ffffff;font-size:2.44vh;font-family:'Open Sans Semibold';\">Melukiskan enam orang wanita memakai kain, selendang tanpa baju sehingga dua buah dadanya kelihatan. Telinganya memakai subeng, rambutnya disanggul di tutup dengan tengkuluk dihias dengan bunga. Mereka berada di sebuah kolam. tampak sebuah bangunan besar berjendela dan berloket banyak, di depan rumah terdapat sebuah kolam. di dalam kolam tumbuh bunga teratai dan kelihatan dua ekor ikan karper. Tepi kolam dihias dengan patung. Di tempat ini empat orang wanita sedang duduk, tangannya dicelupkan ke dalam air, diantara keempat wanita itu, ada seorang yang sedang mencuci nyiru dalam kolam. di pinggir kolam pada air yang lebih dangkal dua orang sedang berdiri memetik bunga. Sedangkan tangan kirinya memegang saab bora. Di sekitar kolam terdapat bunga kembang kertas, kamboja, bunga kembang sepatu dan keladi. Pada cabang pohon tiga ekor burung sedang bertengger. Di atas tanah kelihatan bunga berserakan.</SPAN></SPAN></DIV><p STYLE=\"margin:0; line-height:2.44vh;\"><BR STYLE=\"letter-spacing:0vh;color:#000000;font-size:0.95vh;font-family:Arial, Helvetica, sans-serif;\"/></p><DIV STYLE=\"text-align:justify;\"><SPAN STYLE=\"letter-spacing:0vh;color:#000000;font-family:Arial, Helvetica, sans-serif;\"><SPAN STYLE=\"color:#ffffff;font-size:2.44vh;font-family:'Open Sans Semibold';\">-Karya : Tuan Le-Mayeur</SPAN></SPAN></DIV><DIV STYLE=\"text-align:justify;\"><SPAN STYLE=\"letter-spacing:0vh;color:#000000;font-family:Arial, Helvetica, sans-serif;\"><SPAN STYLE=\"color:#ffffff;font-size:2.44vh;font-family:'Open Sans Semibold';\">-Bahan : Bagor dan Cat Minyak</SPAN></SPAN></DIV><DIV STYLE=\"text-align:justify;\"><SPAN STYLE=\"letter-spacing:0vh;color:#000000;font-family:Arial, Helvetica, sans-serif;\"><SPAN STYLE=\"color:#ffffff;font-size:2.44vh;font-family:'Open Sans Semibold';\">-Warna : Merah, Hitam, Putih</SPAN></SPAN></DIV><DIV STYLE=\"text-align:justify;\"><SPAN STYLE=\"letter-spacing:0vh;color:#000000;font-family:Arial, Helvetica, sans-serif;\"><SPAN STYLE=\"color:#ffffff;font-size:2.44vh;font-family:'Open Sans Semibold';\">-Ruang Penyimpanan : Ruang 5 Dinding Utara</SPAN></SPAN></DIV></div>",
