 "scrollBarMargin": 2,
 "paddingRight": 0,
 "width": "99.964%",
 "shadow": false,
 "backgroundOpacity": 1,
 "paddingTop": 20,
 "borderRadius": 0,
 "backgroundColor": [
  "#D28A5A"
 ],
 "paddingBottom": 0,
 "html": "<div style=\"text-align:left; color:#000; \"><DIV STYLE=\"text-align:justify;\"><SPAN STYLE=\"letter-spacing:0vh;color:#000000;font-family:Arial, Helvetica, sans-serif;\"><SPAN STYLE=\"color:#ffffff;font-size:2.44vh;font-family:'Open Sans Semibold';\">-Deskripsi :</SPAN></SPAN></DIV><DIV STYLE=\"text-align:justify;\"><SPAN STYLE=\"letter-spacing:0vh;color:#000000;font-family:Arial, Helvetica, sans-serif;\"><SPAN STYLE=\"color:#ffffff;font-size:2.44vh;font-family:'Open Sans Semibold';\">Melukiskan tiga buah saka (tiang bangunan). Pada tiang bangunan paling kiri terlihat dua orang wanita berpakaian adat Bali sedang menghaturkan sesajen pada sebuah pelinggih- tempat suci. Di depan pelinggih seorang wanita duduk bersimpuh sambil ngayabang menghaturkan sesaji da yang duduk di belakangnya, membokar sesajen yang ditaruh pada sebuah bakul. Pada tiang bangunan di tengah kelihatan tiga orang wanita, orang yang sedang berdiri seperti orang kesurupan, yang seorang duduk bersimpuh mempersembahkan sesajen segehan di hadapan orang yang kesurupan. Sedangkan yang seorang lagi duduk, tangan kirinya memegang caratan dan tangan kanan ngayabang seperti orang yang menghaturkan tetabuhan. Di samping orang yang kesurupan terdapat sebuah patung. Pada tiang paling kanan tampak dua orang wanita Bali, seorang sedang duduk bersimpuh sambil sembahyang pada sebuah patung pendeta, yang seorang dalam keadaan jongkok menghaturkan canang. Di halaman sebelahnya terdapat sebuah caratan. Wanita ini memakai selendang, kain dan subeng. Rambut dihias dengan bunga. Lukisan dilengkapi dengan pohon kamboja, talas dan bunga kembang sepatu. Dihalaman beberapa kuntum bunga berserakan.</SPAN></SPAN></DIV><p STYLE=\"margin:0; line-height:2.44vh;\"><BR STYLE=\"letter-spacing:0vh;color:#000000;font-size:0.95vh;font-family:Arial, Helvetica, sans-serif;\"/></p><DIV STYLE=\"text-align:justify;\"><SPAN STYLE=\"letter-spacing:0vh;color:#000000;font-family:Arial, Helvetica, sans-serif;\"><SPAN STYLE=\"color:#ffffff;font-size:2.44vh;font-family:'Open Sans Semibold';\">-Karya : Tuan Le-Mayeur</SPAN></SPAN></DIV><DIV STYLE=\"text-align:justify;\"><SPAN STYLE=\"letter-spacing:0vh;color:#000000;font-family:Arial, Helvetica, sans-serif;\"><SPAN STYLE=\"color:#ffffff;font-size:2.44vh;font-family:'Open Sans Semibold';\">-Bahan : Bagor dan Cat Minyak</SPAN></SPAN></DIV><DIV STYLE=\"text-align:justify;\"><SPAN STYLE=\"letter-spacing:0vh;color:#000000;font-family:Arial, Helvetica, sans-serif;\"><SPAN STYLE=\"color:#ffffff;font-size:2.44vh;font-family:'Open Sans Semibold';\">-Warna : Hijau, Merah, Hitam, Biru, Kuning, Coklat</SPAN></SPAN></DIV><DIV STYLE=\"text-align:justify;\"><SPAN STYLE=\"letter-spacing:0vh;color:#000000;font-family:Arial, Helvetica, sans-serif;\"><SPAN STYLE=\"color:#ffffff;font-size:2.44vh;font-family:'Open Sans Semibold';\">-Ruang Penyimpanan : Ruang 6</SPAN></SPAN></DIV><p STYLE=\"margin:0; line-height:2.44vh;\"><BR STYLE=\"letter-spacing:0vh;color:#000000;font-size:0.95vh;font-family:Arial, Helvetica, sans-serif;\"/></p><p STYLE=\"margin:0; line-height:2.44vh;\"><BR STYLE=\"letter-spacing:0vh;color:#000000;font-size:0.95vh;font-family:Arial, Helvetica, sans-serif;\"/></p></div>",
