 "paddingBottom": 0,
 "html": "<div style=\"text-align:left; color:#000; \"><DIV STYLE=\"text-align:justify;\"><SPAN STYLE=\"letter-spacing:0vh;color:#000000;font-family:Arial, Helvetica, sans-serif;\"><SPAN STYLE=\"color:#ffffff;font-size:2.44vh;font-family:'Open Sans Semibold';\">These exhibition rooms at the beginning were the residence and at once the symple studio of the painter Le Mayeur. The house was built in 1933 from local materials of bamboo and wood with a roof of certain grass called \u201calang-alang\u201d. Later on, after he got married with Ni Pollok, the house was gradually rehabilitated to become a beautiful residence consisting of one living-room, one art studio, one bedroom, a dressing room and at once a bathroom. The house was handed over to the Government of Indonesia on 28 August 1957 to become a museum, and since then the house itself with all its painting collections and furnitures has been preserved well up to the present.</SPAN></SPAN></DIV><p STYLE=\"margin:0; line-height:2.44vh;\"><BR STYLE=\"letter-spacing:0vh;color:#000000;font-size:0.95vh;font-family:Arial, Helvetica, sans-serif;\"/></p><p STYLE=\"margin:0; line-height:2.44vh;\"><BR STYLE=\"letter-spacing:0vh;color:#000000;font-size:0.95vh;font-family:Arial, Helvetica, sans-serif;\"/></p></div>",
