 "paddingBottom": 0,
 "html": "<div style=\"text-align:left; color:#000; \"><DIV STYLE=\"text-align:justify;\"><SPAN STYLE=\"letter-spacing:0vh;color:#000000;font-family:Arial, Helvetica, sans-serif;\"><SPAN STYLE=\"color:#ffffff;font-size:2.44vh;font-family:'Open Sans Semibold';\">Ruang pameran ini pada awalnya adalah sebuah rumah tempat tinggal dan ruang studio sederhana dari pelukis Le Mayeur, dibangun pada tahun 1933 dengan bahan dari bambu dan atap alang-alang. Kemudian setelah Le Mayeur menikah dengan Ni Pollok pada tahun 1935, rumah tersebut secara berangsur-angsur direhabilitasi menjadi sebuah rumah yang indah, terdiri dari satu ruang tamu, satu ruang keluarga, satu ruang studio, satu kamar tidur, dan satu ruang hias dan kamar mandi. Sejak diserahkan kepada pemerintah tanggal 28 Agustus 1957 untuk dijadikan sebuah museum, rumah dan segenap koleksi lukisan dan perabot lainnya tetap dilestarikan sampai sekarang.</SPAN></SPAN></DIV></div>",
