 "html": "<div style=\"text-align:left; color:#000; \"><DIV STYLE=\"text-align:justify;\"><SPAN STYLE=\"letter-spacing:0vh;color:#000000;font-family:Arial, Helvetica, sans-serif;\"><SPAN STYLE=\"color:#ffffff;font-size:2.44vh;font-family:'Open Sans Semibold';\">Berbeda dengan yang di Ruangan Pameran disini adalah lukisan asli yang dilukis langsung oleh Le-Mayeur. Dikarenakan di Ruangan Pameran terdapat beberapa lukisan yang di buat duplikasinya untuk di pamerankan. Dan untuk menghidari hal yang tidak di inginkan lukisan yang langsung di lukis Le-Mayeur di tempatkan di gudang, untuk pengunjung diperbolehkan masuk tetapi haru melalui ijin dari petugas dan harus ditemani petugas untuk masuk dikarenakan gedung ini di kunci.</SPAN></SPAN></DIV><p STYLE=\"margin:0; line-height:2.44vh;\"><BR STYLE=\"letter-spacing:0vh;color:#000000;font-size:0.95vh;font-family:Arial, Helvetica, sans-serif;\"/></p><p STYLE=\"margin:0; line-height:2.44vh;\"><BR STYLE=\"letter-spacing:0vh;color:#000000;font-size:0.95vh;font-family:Arial, Helvetica, sans-serif;\"/></p></div>",
